import React from 'react';
import './Navbar.css';
import user from './images/user.jpg'; // Assurez-vous que le chemin est correct
import LOGO from './images/LOGO.PNG'; // Assurez-vous que le chemin est correct et ajoutez l'extension

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src={LOGO} alt="Logo" /> {/* Utilisez LOGO ici sans l'extension */}
      </div>
      <ul className="navbar-menu">
        <li><Link to="/">Accueil</Link></li>
        <li><Link to="/consommation">Consommation</Link></li>
        <li><Link to="/historique">Historique</Link></li>
        <li><Link to="/parametres">Param√®tres</Link></li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
      <div className="navbar-actions">
        <a href="#login" className="login-button">Se Connecter</a>
        <div className="user-icon">
          <img src={user} alt="User" />
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
